export default function ProfileCard( { details } ) {
    
    return (
        <div className="card">
            <h1 className="card__heading">{details.name}</h1>
            <p className="card__desc">{details.desg}</p>
            <div className="card__picture rounded-full outline-offset-2 outline-4">
                <img src={details.picture} alt="Myself" />
            </div>
        </div>
    )
}
